import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link,
  Route,
  Switch
} from 'react-router-dom';
import Main from './Main.js';

function App() {
  return (
    <div className="App">
      <Router>
        <div className="container">
          <nav id="nav">

          </nav>
        </div>

        <Switch>
          <Route exact path="/">
            <Main />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
